import React, { Component } from "react";
import axios from 'axios';

//axios.get(url)

//Global_variable for RESTAPI_URL
const url = `https://jsonplaceholder.typicode.com/users`//array type of Object
class Restapi extends Component {

constructor(props) {
    super(props)

    this.state = 
    {
      userData: [] //empty-array
    }
}

render() {
    return (<>
        <div className="container p-5">


            <h3 class="text-center">FETCH RESTAPI DATA USING GLOBAL URL/CLIENT</h3>

            <table className="table table-dark table-bordered">

             <thead className="table table-light  my-5">
                <tr>
                    <th>ID</th>
                    <th>NAME</th>
                    <th>EMAIL</th>
                    <th>WEBSITE</th>
                    <th>PHONE</th>
                </tr>
             </thead>
           
            <tbody>

            {
                this.state.userData.map( (res,i)=>{
                    return(<tr key={i}>
                        <td>{res.id}</td>
                        <td>{res.name}</td>
                        <td>{res.email}</td>
                        <td>{res.website}</td>
                        <td>{res.phone}</td>
                    </tr>)
                })
            }
            </tbody>
             </table>

        </div>
    </>)
}

//RESTAPI_CALLS
componentDidMount()
{
    axios.get(url).then( (result)=> this.setState({  userData:result.data  })).catch()
}

}


export default Restapi
